class Solution {
public:
	int maxWidthRamp(vector<int>& A) {
		if (A.size() == 0)
		{
			return 0;
		}

		bool fuck = 0;
		int tmp = A[0];
		int maxWidth = 0;
		int tmpMax = 0;
		for (int i = 1; i < A.size(); i++)
		{
			if (tmp < A[i])
			{
				fuck = 1;
				break;
			}
			else if (tmp==A[i])
			{
				tmpMax++;
				if (tmpMax > maxWidth)
					maxWidth = tmpMax;
			}
			else
			{
				tmpMax = 0;
				tmp = A[i];
			}
		}
		if (!fuck)
			return maxWidth;

		int assumeMaxWidth = A.size() - 1;
		while (assumeMaxWidth>0)
		{
			for (int i = 0; i < A.size() - assumeMaxWidth; i++)
			{
				int l = i;
				int r = assumeMaxWidth + i;
				if (A[l] <= A[r])
					return assumeMaxWidth;
			}
			assumeMaxWidth--;
		}
		return 0;
	}
	
};

